import React from 'react';
import '../App.css'
import {Link} from 'react-router-dom'

import Mercury from './Mercury';


function Navbar() {
    return (

             <nav>
        <h2 id="nav-title"><a href="/">THE PLANETS</a></h2>
        <ul>

            <Link to="/mercury"><li>MERCURY</li></Link>


            <li>VENUS</li>
            <li>EARTH</li>
            <li>MARS</li>
            <li>JUPITER</li>
            <li>SATURN</li>
            <li>URANUS</li>
            <li>NEPTUNE</li>
        </ul>
    </nav>
    );
}

export default Navbar;
